import { useNavigate } from "react-router-dom";
import { RiCheckLine, RiArrowRightLine } from "react-icons/ri";

export default function KYCStep4() {
  const navigate = useNavigate();

  const handleConfirm = () => {
    navigate("/kyc-step5");
  };

  return (
    <div className="h-full w-full flex justify-center items-center">
      <div className="w-full max-w-md bg-white p-8 rounded-xl shadow-lg border border-gray-200 text-center">
        <h1 className="text-3xl font-bold mb-6 text-gray-800">Step 4: Review Details</h1>
        <p className="mb-6 text-gray-600">Please review your details and confirm to proceed.</p>

        <ul className="text-left mb-6 space-y-2">
          <li className="flex items-center gap-2"><RiCheckLine className="text-green-500" /> Document type: Aadhaar</li>
          <li className="flex items-center gap-2"><RiCheckLine className="text-green-500" /> Document number: 1234XXXX</li>
        </ul>

        <button
          onClick={handleConfirm}
          className="w-full bg-green-600 hover:bg-green-700 text-white font-semibold py-3 rounded-lg flex justify-center items-center gap-2 transition duration-200"
        >
          Confirm <RiArrowRightLine size={20} />
        </button>
      </div>
    </div>
  );
}
